import React, { Component } from "react";

class Button extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <button
        className={`border-2 border-gray-600 rounded-lg ${
          this.props.myBg - color
        } ${
          this.props.mTtext - color
        } w-24 font-bold p-3 flex justify-center items-center mr-14 hover:bg-red-300 shadow-inner`}
      >
        {this.props.title}
      </button>
    );
  }
}

export { Button };
